import e from "express";
import React, { Component } from "react";
import "./Contact.css";

class Contact extends Component {
    state = {
        firstname: "",
        lastname: "",
        phonenumber: "",
        email: "",
        message: ""
    }

    handleName = (e) => {
        this.setState({
            name: e.target.name
        });
    };

    handleLastname = (e) => {
        this.setState({
            lastname: e.target.lastname
        });
    };

    handlePhonenumber = (e) => {
        this.setState({
            phonenumber: e.target.phonenumber
        });
    };

    handleEmail = (e) => {
        this.setState({
            email: e.target.email
        });
    };

    handleMessage = (e) => {
        this.setState({
            message: e.target.message
        });
    };

    render() {
        const { email } = this.state;
        return (
            <div className="contact">
                <h1>Contact Us</h1>
                <div className="contact-container">
                    <form>
                        <input className="input-box" value={email.firstname} onChange={this.handleName} placeholder="First Name" type="text" />
                        <input className="input-box" value={email.lastname} onChange={this.handleLastname} placeholder="Last Name" type="text" />
                        <input className="input-box" value={email.phonenumber} onChange={this.handlePhonenumber} placeholder="Phone Number" type="tel" />
                        <input className="input-box" value={email.email} onChange={this.handleEmail} placeholder="Email" type="email" />
                        <textarea className="message-box" value={email.message} onChange={this.handleMessage} placeholder="Message" type="text" />
                        <button className="submit-btn" type="submit" value="submit">Submit</button>
                    </form>
                    <img className="map" src="images/map.png" alt="" />
                </div>
            </div>
        );
    }
}

export default Contact;
